defmodule Aoc2018.Day5 do

  def a do
    parse_input()
    |> reduce_polymers([])
  end

  def b do
    p_i = parse_input()
    cord = self()
    rej =
      Enum.reduce(65..90, %{},
        fn(i, acc) ->
          spawn_link(
            fn() ->
              res =
                p_i
                |> Enum.reject(fn(x) -> x == i or x == i + 32 end)
                |> reduce_polymers([])
                |> length()
              send(cord, {i, res})
            end
          )
        Map.put_new(acc, i, 0)
        end
      )
    rej |> loop(%{}) |> Enum.min()

  end

  def loop(await, acc) when map_size(await) == 0, do: acc

  def loop(await, acc) do
    receive do
      {id, res} ->
        {_, rem_await} = Map.pop(await, id)
        loop(rem_await, Map.put_new(acc, id, res))
    end
  end

  def reduce_polymers([], reduced), do: reduced

  def reduce_polymers([a | rest], []) do
    reduce_polymers(rest, [a])
  end

  def reduce_polymers([a | rest], [h | r_a] = acc) do
    case a - h do
      int when int == -32 or int == 32 ->
        reduce_polymers(rest, r_a)
      _ -> reduce_polymers(rest, [a|acc])
    end
  end

  def parse_input(input \\ input()) do
    String.to_charlist(input)
  end

  def input do
    ""
  end

end
